import React from "react";
import {Route} from "react-router-dom";


const About = (props) => {
    return (
        <div>
            <span>About - {props.title}</span>
            <ul>
                <li className="btn-primary m-2"> 1 </li>
                <li className="btn-primary"> 2 </li>
            </ul>
        </div>
    );
};

export default About;
